import React, { Component } from "react";
//import InfiniteCalendar from 'react-infinite-calendar';
import InfiniteCalendar, {
  Calendar,
  defaultMultipleDateInterpolation,
  withMultipleDates,
  withRange,
} from 'react-infinite-calendar';
import 'react-infinite-calendar/styles.css';



class RightSection extends Component {

  state = {
    date: new Date('03-15-1994')
  };


  onChange = date => this.setState({ date });


  render() {

    // if(this.props.eventsData.events != undefined){
    //   console.log(this.props.eventsData.events[0].name);
    // }

    return (
      <div>

       <InfiniteCalendar

  Component={withRange(Calendar)}
    selected={[{
      start: new Date(2017, 1, 10),
      end: new Date(2017, 1, 18),
    },{
      start: new Date(2017, 1, 20),
      end: new Date(2017, 1, 22),
    }]
    }
/>
      </div>
    );
  }
}

export default RightSection;
